import React, { Component } from 'react'

export default class Home extends Component {
  componentDidMount() {
    if ('serviceWorker' in navigator) {
      window.addEventListener('load', function () {
        navigator.serviceWorker.register('service-worker-push.js').then(function (registration) {
          console.log('Worker registration is successful', registration.scope);
          return registration;
        }, function (err) {
          console.log('Worker registration has failed', err);
        }).catch(function (err) {
          console.log(err);
        });
      });
    } else {
      console.log('Service Worker is not supported by your browser.');
    }
  }
  render() {
    return (
      <div>
        <h1>Home page</h1>
      </div>
    )
  }
}
